import React from "react";
import { CircularProgress, Grid, FormControlLabel } from "@material-ui/core";

// hook
import { useFetch } from "../../../hooks";
// components
import CultrueCards from "./CultureCards";

const ClientCulture = () => {
  const { data, isLoading } = useFetch("/cultures/group");

  const cultureCards = data.map((information) => (
    <Grid key={information._id} item xs={12}>
      <CultrueCards
        countrySource={information._id}
        information={information.data}
      />
    </Grid>
  ));

  const titleCards = data.map((information) => (
    <FormControlLabel
      color="primary"
      label={information._id}
    ></FormControlLabel>
  ));

  return (
    <div>
      <Grid item xs={12}>
        <Grid container spacing={3}>
          {isLoading ? (
            <Grid item xs={12}>
              <CircularProgress />
            </Grid>
          ) : (
            [
              <div className={classes.root}>{titleCards}</div>,
              <Grid item xs={12}>
                {cultureCards}
              </Grid>,
            ]
          )}
        </Grid>
      </Grid>
    </div>
  );
};

export default ClientCulture;
